goog.provide("goog.ui.emoji.Emoji");goog.ui.emoji.Emoji=function(url,id,opt_height,opt_width,opt_altText){this.url_=url;this.id_=id;this.height_=opt_height||null;this.width_=opt_width||null;this.altText_=opt_altText||null};goog.ui.emoji.Emoji.ATTRIBUTE="goomoji";goog.ui.emoji.Emoji.DATA_ATTRIBUTE="data-"+goog.ui.emoji.Emoji.ATTRIBUTE;goog.ui.emoji.Emoji.prototype.getUrl=function(){return this.url_};goog.ui.emoji.Emoji.prototype.getId=function(){return this.id_};goog.ui.emoji.Emoji.prototype.getHeight=function(){return this.height_};goog.ui.emoji.Emoji.prototype.getWidth=function(){return this.width_};goog.ui.emoji.Emoji.prototype.getAltText=function(){return this.altText_};